-- Créez une table pour stocker les données de l'enquête.
CREATE TABLE IF NOT EXISTS survey_data (
                                           question_text TEXT,
                                           user_id UUID,
                                           response TEXT
);

-- Insérez des données dans la table.

select * from survey_data;
select count(*) from public.survey_data;

--Distribution des reponses
select
    survey_data.question_text,
    count(*)
from survey_data
group by question_text
order by question_text;

--La succursale la plus populaire.
select
    survey_data.question_text,
    count(*)
from survey_data
group by question_text
order by question_text;

SELECT response, cpt
FROM (
         SELECT response, COUNT(*) AS cpt
         FROM survey_data
         WHERE question_text LIKE '2%'
         GROUP BY response
         ORDER BY cpt DESC
     ) AS rqt
LIMIT 1;

--Segmentation démographique :
-- segmenter les répondants en fonction de leur âge, de leur genre ou de leur revenu du ménage

--Par âge
select survey_data.question_text, count(*) from survey_data group by question_text order by question_text;

SELECT
    response AS age_group,
    COUNT(*)
FROM survey_data
WHERE question_text LIKE '3%'
GROUP BY age_group
ORDER BY age_group;

--Par genre
select survey_data.question_text, count(*) from survey_data group by question_text order by question_text;

SELECT
    response AS gender,
    COUNT(*)
FROM survey_data
WHERE question_text LIKE '4%'
GROUP BY gender
ORDER BY gender;

--Par revenue
select
    survey_data.question_text,
    count(*)
from
    survey_data
group by question_text
order by question_text;

SELECT
    response AS income_group,
    COUNT(*)
FROM survey_data
WHERE question_text LIKE '5%'
GROUP BY income_group
ORDER BY income_group;

--Score de Recommandation Net (Net Promoter Score)
select survey_data.question_text, count(*) from survey_data group by question_text order by question_text;

SELECT user_id,
       CASE
           WHEN CAST(response AS NUMERIC) > 8 THEN 'Promoter'
           ELSE 'Passive'
           END
           AS nps_segment
FROM survey_data
WHERE question_text LIKE '1%';

--Pourcentage de répondants qui agiraient en tant que promoteurs pour nos produits.
select survey_data.question_text, count(*) from survey_data group by question_text order by question_text;

SELECT
    COUNT(
       CASE
           WHEN CAST(response AS NUMERIC) > 8 THEN 1
       END) * 100 / COUNT(*)
    AS percentage_promoters
FROM
    survey_data
WHERE
    question_text LIKE '1%';
